  [],\n\t\"revision_timestamp\": \"2016-07-27T23:00:25.597802\",\n\t\"name\": \"guam-leucaena-leucocephala-control-and-restoration-and-early-detection-monitoring-for-inva\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Over the next 5 years there is planned
  to be a dramatic increase in population and infrastructure due to an increase in
  military activity on the island of Guam. Guam National Wildlife Refuge (NWR) is
  situated on the North end of the island surrounded by two military bases, one of
  which is a major port of entry for the planned import and export of people and materials.
  In turn these activities will place Guam NWR at higher risk of invasion by new pest
  species. The refuge would therefore like to start a vegetation and insect early
  detection monitoring program. In addition to the early detection monitoring the
  refuge would also like to concentrate on control and restoration of a section of
  beach strand with invasivevegetation (Leucaena leucocephala). This will enhance
  the section of the Refuge open to the public. All aspects of this project will involve
  participation by volunteers, from pulling invasive plants to collecting and training
  to identify insects and vegetation.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
